import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import ProductList from './components/ProductList';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import { CartProvider } from "./contexts/CartContext";
import Cart from './components/Cart/Cart';
import AdminPanel from './components/Admin/AdminPanel';
import ProtectedRoute from './components/ProtectedRoute';
import { useAuth } from './contexts/AuthContext';
import Dashboard from './components/Admin/Dashboard';
import Products from './components/'
import './app.css';
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

export default function App() {
  const { isLoggedIn, logout, user } = useAuth();

  const handleLogout = () => {
    logout();
    toast.success("Logout Successful!");
  };

  return (
    <CartProvider>
      <div>

        {/* --- TOP NAVBAR --- */}
        <nav className="navbar">
          <div className="nav-left">
            <Link className="logo" to="/">GuruKrupa GiftArticle</Link>

            <div className="nav-links">
              <Link to="/">Home</Link>
              <Link to="/products">Products</Link>

              {/* üî• Show only if logged in AND admin */}
              {user?.role === "admin" && (
                <Link to="/admin">Admin</Link>
              )}
            </div>
          </div>

          <div className="nav-center">
            <input className="search-box" placeholder="Search products..." />
          </div>

          <div className="nav-right">
            <Link className="cart-link" to="/cart">
              üõí <span className="cart-badge"></span>
            </Link>

            <div className="auth-links">

              {/* üî• If user logged in ‚Üí show welcome + logout */}
              {isLoggedIn ? (
                <>
                  <span className="user-info">
                    Welcome, {user?.name || "User"}
                  </span>
                  <button onClick={handleLogout} className="logout-btn">Logout</button>
                </>
              ) : (
                /* üî• If NOT logged in ‚Üí show Login + Signup */
                <>
                  <Link to="/login">Login</Link>
                  <Link to="/signup" className="signup-btn">Signup</Link>
                </>
              )}

            </div>
          </div>
        </nav>

        <ToastContainer position="top-right" autoClose={2000} />

        {/* --- ROUTES --- */}
        <div className="page-container">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/products" element={<ProductList />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/cart" element={<Cart />} />

            {/* üîê Admin Only Routes */}
            <Route path="/admin" element={<ProtectedRoute><AdminPanel /></ProtectedRoute>} />
            <Route path="/admin/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
             <Route path="products" element={<Products />} />
  <Route path="orders" element={<Orders />} />
  <Route path="settings" element={<Settings />} />
          </Routes>
        </div>

      </div>
    </CartProvider>
  );
}
